import React from "react";

const Profile = () => {
    return (
        <section className="scroll-section">
            <div className="profile-content">
                <h2>Profile</h2>
                <p>안녕하세요! 저는 게임 개발자 Kim Tae Woo입니다.</p>
            </div>
        </section>
    );
};

export default Profile;
